import React, { useState, useEffect } from "react";
import { Card, Button } from 'react-bootstrap';
import { getVehiclesByReportNumber, getDriversByVehicleNumber } from "../api/api";

export default function CrashCard({ crash }) {
    const [vehicles, setVehicles] = useState(null);
    const init = () => {
        getVehiclesByReportNumber(crash.report_number).then(vehicleData => {
            let vehicles = vehicleData;
            console.log(vehicles)
            getDriversByVehicleNumber(crash.report_number, vehicleData.vehicle_number).then(driverData => {
                vehicles = [...vehicleData, driverData];
                setVehicles({
                    vehicles: vehicles
                });

                // console.log(vehicles)
            })
        });
    };

    useEffect(() => {
        init();
    }, []);

    return (
        <Card>
            <Card.Header>{crash.crash_severity}| {crash.on_street} @ {crash.city}, {crash.county}</Card.Header>
            <Card.Body>
                <Card.Title></Card.Title>
                <Card.Text>
                    With supporting text below as a natural lead-in to additional content.
    </Card.Text>
                <Button variant="primary">Go somewhere</Button>
            </Card.Body>
        </Card>
    );
};
